var map = L.map('map').setView([42.35, -83.05], 10);
//[42.3314, -83.0458]

// Add osm layer
var osm = L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
    attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
});
osm.addTo(map);

// WMS request
var wmsLayer = L.tileLayer.wms("http://localhost:8080/geoserver/wms", {
  layers: "temp1:AOC_MI_Detroit_2021",
  format: 'image/png',
  transparent: true,
  attribution: "GeoServer"
});
wmsLayer.addTo(map);

// New Berrien water layer for City Parks
var BerrienFLood = L.tileLayer.wms("http://localhost:8080/geoserver/wms", {
    layers: "cite:BerrienFloodExtentExample", 
    format: 'image/png',
    transparent: true,
    attribution: "GeoServer"
});
BerrienFLood.addTo(map);

// Base layers object for layer control
var baseMaps = {
    "OpenStreetMap": osm
};

// Overlay layers object for layer control
var overlayMaps = {
    "Detroit River": wmsLayer,
    "Berrien Flood": BerrienFLood
};

// Add layer control to the map
L.control.layers(baseMaps, overlayMaps).addTo(map);

// Using leaflet draw
// Initialize the FeatureGroup to store editable layers
var drawnFeatures = new L.FeatureGroup();
map.addLayer(drawnFeatures);

// Add draw control to the map with the FeatureGroup as the edit option
var drawControl = new L.Control.Draw({
    edit: {
        featureGroup: drawnFeatures,
        remove: false
    },
    draw: {
        polygon: true,
        polyline: true,
        rectangle: true,
        circle: true,
        marker: true
    }
});
map.addControl(drawControl);

// Save the drawn feature to the FeatureGroup
map.on("draw:created", function(e) {
    var type = e.layerType;
    var layer = e.layer;
    console.log(layer.toGeoJSON()); // Convert to GeoJSON

    // Write a popup to show the feature 
    layer.bindPopup(`<p>${JSON.stringify(layer.toGeoJSON())}</p>`);

    drawnFeatures.addLayer(layer);

    // Update legend
    updateLegend(type);

    // Show the popup form after drawing a polygon, rectangle, circle, or marker
    if (type === 'polygon' || type === 'rectangle' || type === 'circle' || type === 'marker') {
        var latlng;
        if (type === 'marker') {
            latlng = layer.getLatLng();
        } else {
            latlng = layer.getBounds().getCenter();
        }
        createPopupForm(latlng);
    }
});

map.on("draw:edited", function(e) {
    var layers = e.layers;
    var type = e.layerType;

    layers.eachLayer(function(layer) {
        console.log(layer);
    });
});

function updateLegend(type) {
    var legend = document.getElementById('legend');
    var newEntry = document.createElement('div');
    newEntry.innerHTML = `<b>${type}</b>`;
    legend.appendChild(newEntry);
}

function saveGeoJSON() {
    var geojson = drawnFeatures.toGeoJSON();
    var blob = new Blob([JSON.stringify(geojson)], {type: "application/json"});
    saveAs(blob, "drawnFeatures.geojson");
}

// Function to create a popup with a form
function createPopupForm(latlng) {
    var popupContent = `
        <form class="popup-form" enctype="multipart/form-data">
            <label for="real-time">Real Time:</label>
            <input type="datetime-local" id="real-time" name="real-time">
            
            <label for="picture">Upload Picture:</label>
            <input type="file" id="picture" name="picture" accept="image/*">
            
            <button type="submit">Submit</button>
        </form>
    `;
    var popup = L.popup()
        .setLatLng(latlng)
        .setContent(popupContent)
        .openOn(map);
}

// Handle form submission
document.addEventListener('submit', function(event) {
    event.preventDefault();
    var form = event.target;

    if (form.classList.contains('popup-form')) {
        var realTime = form['real-time'].value;
        var picture = form['picture'].files[0];

        var formData = {
            realTime: realTime,
            picture: picture ? picture.name : null
        };

        // Save form data to localStorage
        var storedData = localStorage.getItem('formData') ? JSON.parse(localStorage.getItem('formData')) : [];
        storedData.push(formData);
        localStorage.setItem('formData', JSON.stringify(storedData));

        alert('Data 3d locally!');
    }
});

// Function to recentralize the map
function recentralizeMap() {
    map.setView([42.98, -86.44], 10); // Sets view to Detroit with a specific zoom
}

// Add a button for recentralizing the map
var recentralizeBtn = L.control({position: 'topright'});
recentralizeBtn.onAdd = function (map) {
    var div = L.DomUtil.create('div', 'leaflet-bar');
    div.innerHTML = '<button onclick="recentralizeMap()">Recentralize to Berrien</button>';
    return div;
};
recentralizeBtn.addTo(map);


